INSERT INTO `encuesta` VALUES (3,'Ansiedad','A continuación, encontrará algunas afirmaciones. Lea atentamente cada frase indique por favor el grado de acuerdo o desacuerdo con respecto a las mismas. Señale con una “X” la respuesta que más se aproxime a sus preferencias. Responda en relación como se ha sentido durante los últimos quince días (dos semanas más recientes)','#114caf'),(4,'Depresión','A continuación, encontrará algunas afirmaciones. Lea atentamente cada frase indique por favor el grado de acuerdo o desacuerdo con respecto a las mismas. Señale con una “X” la respuesta que más se aproxime a sus preferencias.\r\nResponda en relación como se ha sentido durante los últimos quince días (dos semanas más recientes)\r\n','#156fcc'),(5,'Escala de Inteligencia Emocional','En este cuestionario encontrarás algunas afirmaciones sobre tus emociones y sentimientos. Lea atentamente cada afirmación e indique el grado de acuerdo o desacuerdo con cada una de ellas marcando con una X el número que más se acerque a sus preferencias.\r\nTen siempre presente que no hay respuestas correctas o incorrectas, ni buenas o malas. No pase demasiado tiempo pensando en cada respuesta.\r\n','#475fc8'),(6,'Escala de Estrés Percibido ','Las preguntas en esta escala hacen referencia a sus sentimientos y pensamientos durante el último mes. En cada caso, por favor indique con una “X” cómo usted se ha sentido o ha pensado en cada situación.','#cf45a5'),(7,'Inventario de Pensamientos Automáticos ','A continuación, encontraras una lista de pensamientos que suelen presentar las personas ante diversas situaciones. Se trata de que valores la frecuencia con que sueles pensarlos, siguiendo la escala que se te presenta a continuación:','#1c8caf');
