INSERT INTO `pregunta` VALUES (18,'No pude dejar de estar triste a pesar de la ayuda de amigos y familiares',1,4),(19,'Me sentí deprimido (a)',2,4),(20,'Pensé que mi vida ha sido un fracaso',3,4),(21,'Me sentí nervioso',4,4),(22,'Estuve feliz',5,4),(23,'Me sentí solo (a)',6,4),(24,'Disfruté la vida',7,4),(25,'Tuve crisis de llanto',8,4),(26,'Me sentí triste',9,4),(27,'Sentí que no podía seguir adelante',10,4),(28,'Me siento más nervioso y ansioso que de costumbre.',1,3),(29,'Me da miedo sin razón alguna.',2,3),(30,'Me enojo fácilmente o siento pánico.',3,3),(31,'Siento que me estoy desmoronando.',4,3),(32,'Mis brazos y piernas tiemblan.',5,3),(33,'Me molestan los dolores de cabeza, cuello y dolor de espalda.',6,3),(34,'Me siento débil y me canso fácilmente.',7,3),(35,'Puedo sentir mi corazón latir rápido.',8,3),(36,'Me molestan los mareos.',9,3),(37,'Tengo desmayos o sensación de desmayos.',10,3),(38,'Tengo sensación de entumecimiento y hormigueo en mis dedos de manos y pies.',11,3),(39,'Me molestan los dolores de estómago o la indigestión.',12,3),(40,'Tengo que vaciar mi vejiga con frecuencia.',13,3),(41,'Se me calienta la cara y se me pone enrojecida.',14,3),(42,'Tengo pesadillas.',15,3),(43,'Presto mucha atención a mis sentimientos. ',1,5),(44,'Me preocupan mucho mis sentimientos',2,5),(45,'Me resulta útil pensar en mis emociones.',3,5),(46,'Vale la pena prestar atención a mis emociones y estados de ánimo.',4,5),(47,'Dejo que mis sentimientos se interpongan en mis pensamientos.',5,5),(48,'Pienso constantemente en mi estado de ánimo. ',6,5),(49,'A menudo pienso en mis sentimientos.',7,5),(50,'Presto mucha atención a lo que siento.  ',8,5),(51,'Suelo saber lo que siento',9,5),(52,'A menudo puedo saber lo que siento.',10,5),(53,'Casi siempre sé exactamente lo que siento.',11,5),(54,'Suelo conocer mis sentimientos sobre las personas o cualquier tema',12,5),(55,'A menudo soy consciente de lo que siento sobre cualquier tema.',13,5),(56,'Siempre puedo decir lo que siento.',14,5),(57,'A veces puedo decir lo que siento.',15,5),(58,'Puedo entender lo que siento.',16,5),(59,'Aunque a veces estoy triste, casi siempre tengo una actitud optimista.',17,5),(60,'Aunque me sienta mal, intento pensar en cosas bonitas.',18,5),(61,'Cuando me aburro, pienso en las cosas agradables de la vida.',19,5),(62,'Intento tener pensamientos positivos aunque me sienta mal.',20,5),(63,'Si siento que estoy perdiendo la cabeza, intento calmarme.',21,5),(64,'Me preocupo por mantener un buen estado de ánimo.',22,5),(65,'Siempre tengo mucha energía cuando soy feliz.',23,5),(66,'Cuando estoy enfadado, intento cambiar mi estado de ánimo.',24,5),(67,'En el último mes, ¿con qué frecuencia ha estado afectado por algo que ha ocurrido inesperadamente?',1,6),(68,'En el último mes, ¿con qué frecuencia se ha sentido incapaz de controlar las cosas importantes en su vida?',2,6),(69,'En el último mes, ¿con qué frecuencia se ha sentido nervioso o estresado?',3,6),(70,'En el último mes, ¿con qué frecuencia ha manejado con éxito los pequeños problemas irritantes de la vida?',4,6),(71,'En el último mes, ¿con qué frecuencia ha sentido que ha afrontado con eficacia los cambios importantes que han estado ocurriendo en su vida?',5,6),(72,'En el último mes, ¿con qué frecuencia ha estado seguro sobre su capacidad para manejar sus problemas personales?',6,6),(73,'En el último mes, ¿con qué frecuencia ha sentido que las cosas le van bien?',7,6),(74,'En el último mes, ¿con qué frecuencia ha sentido que no podía afrontar todas las cosas que tenía que hacer?',8,6),(75,'En el último mes, ¿con qué frecuencia ha podido controlar las dificultades de su vida?',9,6),(76,'En el último mes, ¿con qué frecuencia se ha sentido que tenía todo bajo control?',10,6),(77,'En el último mes, ¿con qué frecuencia ha estado enfadado porque las cosas que le han ocurrido estaban fuera de su control?',11,6),(78,'En el último mes, ¿con qué frecuencia ha pensado sobre las cosas que le quedan por hacer?',12,6),(79,'