35,7),(116,'La gente hace las cosas mejor que yo',36,7),(117,'Soy una víctima de mis circunstancias',37,7),(118,'No me tratan como deberían hacerlo y me lo merezco',38,7),(119,'Si tengo estos síntomas es porque soy un enfermo',39,7),(120,'Si tuviera mejor situación económica no tendría estos problemas',40,7),(121,'Soy un neurótico',41,7),(122,'Lo que me pasa es un castigo que merezco',42,7),(123,'Debería recibir más atención y cariño de otros',43,7),(124,'Tengo razón y voy a hacer lo que me da la gana',44,7),(125,'Tarde o temprano irán las cosas mejor',45,7);
